import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const ImageTextCarousel = () => {
  return (
    <Carousel>
      <div>
        <img src="/assets/books.jpeg" alt="Image 1" />
        <p className="legend">Image 1 description</p>
      </div>
      <div>
        <img src="/assets/tutors2." alt="Image 2" />
        <p className="legend">Image 2 description</p>
      </div>

    </Carousel>
  );
};

export default ImageTextCarousel;
